import React, { Component } from 'react';
import ItemProduct from './ItemProduct';
class MainRight extends Component {
    render() {
        return (
       <div className="right-item-cat" style={{width: '65%'}}>
  <div className="row">
   <ItemProduct/>
  </div>
   <div className="list-pages">
    <a href="#">1</a>
    <a href="#">2</a>
    <a href="#">3</a>
    <a href="#">4</a>
    <a href="#">5</a>
  </div>
</div>
        )
    }
}
export default MainRight;
